        "publishedAt": "2022-04-03T16:14:15Z",
        "channelId": "UCGHZpIpAWJQ-Jy_CeCdXhMA",
        "title": "Why Going Faster-Than-Light Leads to Time Paradoxes",
        "description": "Is faster-than-light (FTL) travel possible? In most discussions of this, we get hung up on the physics of particular ideas, such as wormholes or warp drives. But today, we take a more zoomed out approach that addresses all FTL propulsion - as well as FTL messaging. Because it turns out that they all allow for time travel. Join us today as we explore why this is so and the profound consequences that ensue.\n\nWritten & presented by Prof David Kipping. Special thanks to Prof Matt Buckley for fact checking and his great blog article that inspired this video (http://www.physicsmatt.com/blog/2016/8/25/why-ftl-implies-time-travel). Please abide by our rule of courteous and respectful interactions with one another in the comments section.\n\n→ Support our research program: https://www.coolworldslab.com/support\n→ Get Stash here! https://teespring.com/stores/cool-worlds-store\n\nTHANK-YOU to our supporters D. Smith, M. Sloan, C. Bottaccini, D. Daughaday, A. Jones, S. Brownlee, N. Kildal, Z. Star, E. West, T. Zajonc, C. Wolfred, L. Skov, G. Benson, A. De Vaal, M. Elliott, B. Daniluk, M. Forbes, S. Vystoropskyi, S. Lee, Z. Danielson, C. Fitzgerald, C. Souter, M. Gillette, T. Jeffcoat, H. Jensen, J. Rockett, N. Fredrickson, D. Holland, E. Hanway, D. Murphree, S. Hannum, T. Donkin, K. Myers, A. Schoen, K. Dabrowski, J. Black, R. Ramezankhani, J. Armstrong, K. Weber, S. Marks, L. Robinson, F. Van Exter, S. Roulier, B. Smith, P. Masterson, R. Sievers, G. Canterbury, J. Kill, J. Cassese, J. Kruger, S. Way, P. Finch, S. Applegate, L. Watson, T. Wheeler, E. Zahnle, N. Gebben, J. Bergman, E. Dessoi, J. Alexander, C. Macdonald, M. Hedlund, P. Kaup, C. Hays, S. Krasner, W. Evans, J. Curtin, J. Sturm, RAND Corp, T. Kordell, T. Ljungberg & M. Janke.\n\n::References::\n► Alcubierre, M., 1994, \"The warp drive: hyper-fast travel within general relativity\", Classical and Quantum Gravity, 11 L73: https://arxiv.org/abs/gr-qc/0009013\n► Pfenning, M. & Ford, L., 1997, \"The unphysical nature of Warp Drive\", Classical and Quantum Gravity, 14, 1743: https://arxiv.org/abs/gr-qc/9702026\n► Finazzi, S., Liberati, S., Barceló, C., 2009, \"Semiclassical instability of dynamical warp drives\", Physical Review D., 79, 124017: https://arxiv.org/abs/0904.0141\n► McMonigal, B., Lewis, G., O'Byrne, P., 2012, \"Alcubierre warp drive: On the matter of matter\", Physical Review D., 85, 064024: https://arxiv.org/abs/1202.5708\n► Everett, A., 1996, \"Warp drive and causality\", Physical Review D, 53, 7365: https://journals.aps.org/prd/abstract/10.1103/PhysRevD.53.7365\n► For a more rigorous breakdown of the axis flipping in Minkowski spacetime, see Chapter 3 of \"Special Relativity\" by Valerio Faraoni (Chapter 3 is also available here https://williamsgj.people.cofc.edu/Minkowski%20Spacetime.pdf)\n\n::Music::\nMusic licensed by SoundStripe.com (SS) [shorturl.at/ptBHI], or via Creative Commons (CC) Attribution License (https://creativecommons.org/licenses/by/4.0/), or with permission from the artist\n► Hill - An Interesting Retirement [https://open.spotify.com/album/3S2hu2EP1lYOXHzwEHcclb]\n► Joachim Heinrich - Stjärna\n► Falls - Life In Binary\n► Chris Zabriskie - Cylinder Two\n► Chris Zabriskie - Cylinder Five\n► Chris Zabriskie - Cylinder Four\n► Falls - Ripley\n► Caleb Etheridge - Always Dreaming\n► Joachim Heinrich - Y\n► Indive - Trace Correction\n\n::Film/TV clips used::\n► Interstellar (2014) Paramount Pictures\n► Contact (1997) Warnes Bros.\n► The Imitation Game (2014) The Weinstein Company\n► Star Trek: Generations (1994) Paramount Pictures\n► Cosmos: Possible Worlds (2020) National Geographic Fox\n► Stephen Hawking's Favorite Places (2016) Curiosity Stream\n► Star Wars: The Empire Strikes Back (1980) 20th Century Fox\n► Star Trek: Deep Space Nine (1993-1999) Paramount Television\n► The Day The Earth Stood Still (2008) 20th Century Fox\n► Stargate (1994) MGM/UA Distribution Co.\n► Star Trek: Beyond (2016) Paramount Pictures\n► Star Trek 